import { Route, Switch } from 'react-router-dom'
import Package from './Package/Package'

const App = () => {
  return (
    <Switch>
      <Route exact path="/" component={Packages}/>
      <Route exact path="/packages/:slug" component={Package}/>
    </Switch>
  )
}

export default App
